import React, { useState } from 'react';
import { Grid, Button, TextField } from '@mui/material';
import dayjs from 'dayjs';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DateTimePicker } from '@mui/x-date-pickers/DateTimePicker';

const initialValues = {
  startedAt: dayjs(), // Keep as dayjs object
  endsAt: dayjs(),
};

export const createCalendar = () => {
  const [formValues, setFormValues] = useState(initialValues);

  const handleDateChange = (date, dateType) => {
    // Keep the date as dayjs object
    setFormValues({ ...formValues, [dateType]: date });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formValues); // Submit the form values (dayjs objects)
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      <Grid item xs={12}>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <DateTimePicker
            renderInput={(props) => <TextField {...props} />}
            label="Start Date and Time"
            value={formValues.startedAt} // Use dayjs object
            onChange={(newValue) => handleDateChange(newValue, "startedAt")}
            inputFormat="MM/dd/yyyy hh:mm a"
            className="w-full"
            sx={{ width: "100%" }}
          />
        </LocalizationProvider>
      </Grid>

      <Grid item xs={12}>
        <LocalizationProvider dateAdapter={AdapterDayjs}>
          <DateTimePicker
            renderInput={(props) => <TextField {...props} />}
            label="End Date and Time"
            value={formValues.endsAt} // Use dayjs object
            onChange={(newValue) => handleDateChange(newValue, "endsAt")}
            inputFormat="MM/dd/yyyy hh:mm a"
            className="w-full"
            sx={{ width: "100%" }}
          />
        </LocalizationProvider>
      </Grid>

      <Button variant="contained" color="primary" type="submit">
        Submit
      </Button>
    </form>
  );
};
